          -- ----------------------------

          -- Table structure for certification

          -- ----------------------------

          DROP TABLE IF EXISTS `gtt_certification`;

          CREATE TABLE `gtt_certification`  (

          `id` bigint NOT NULL,

          `country_name` varchar(32) CHARACTER SET utf8mb4 COLLATE utf8mb4_unicode_ci
          NULL DEFAULT NULL COMMENT ''国家名称'',

          `country_code` varchar(32) CHARACTER SET utf8mb4 COLLATE utf8mb4_unicode_ci
          NULL DEFAULT NULL COMMENT ''国家编码'',

          `certificate` varchar(32) CHARACTER SET utf8mb4 COLLATE utf8mb4_unicode_ci
          NULL DEFAULT NULL COMMENT ''评级'',

          PRIMARY KEY (`id`) USING BTREE

          ) ENGINE = InnoDB CHARACTER SET = utf8mb4 COLLATE = utf8mb4_unicode_ci ROW_FORMAT
          = Dynamic;


